script: |
  super -f tsv -I q2233.sql | sort > q2233.out

vector: true

inputs:
  - name: q2233.sql
    data: |
      SELECT ALL - + 4 FROM tab1 WHERE NOT - 11 BETWEEN + col2 * + col1 AND - + col2 + - + CAST ( NULL AS INTEGER ) / - col0 + col0;
  - name: tab1

outputs:
  - name: q2233.out
    data: |
      -4
      -4
      -4
